import React from 'react';
import { Container, Row, Col } from 'react-bootstrap';
import Calendar from './index';
import Weather from '../weather/weather'


function showCalendar({showCalendar, form, value, setValue, back, booked}) {
    
    let calendar = null
    if (showCalendar){
        calendar = (
        <Container fluid>
            <Row>
                <Col sm={4} ></Col>
                <Col sm={4} >
                    <br></br>
                    <h3>Pick A Date!</h3>
                    <br></br>
                </Col>
                <Col sm={4} ></Col>
            </Row>
            <Row>
              <Col><p className='kayaks-0'>kayaks = 0</p></Col>
              <Col><p className='kayaks-2'>kayaks > 2</p></Col>
              <Col><p className='kayaks-4'>kayaks > 4</p></Col>
              <Col><p className='kayaks-6'>kayaks > 6</p></Col>
              <Col><p className='kayaks-8'>kayaks > 8</p></Col>
            </Row>
            <Calendar form={form} back={back} value={value} onChange={setValue} booked={booked} />
            <br></br>
            <hr></hr>
            <br></br>
            <Weather/>
        </Container>)
    } else { calendar = null };
    

    
    return (
        <div>
            {calendar}
        </div>
    )
}

export default showCalendar;
